import React from 'react';
import './chatButton.css';

function ChatButton(props) {
    function handleClick() {
        if (props.onClick) {
            props.onClick();
        }
    }
    return (
        <button className="chat-button" onClick={handleClick}>
            <i className="fa fa-comment-o"></i>
        </button>
    );
}

export default ChatButton;
